ATTRIBUTE.VALUE:
DELETE FROM BI_INVENTORY WHERE AS_OF_DATE= to_date('$$AS_OF_DATE','MM/DD/YYYY') AND
UPDATE_USERID='haa_inventory_load' and DIVISION_CODE='$$DIVISION_CODE'
AND STANDARD_COST_CURRENCY  IN (SELECT DISTINCT STG_HAA_INVENTORY.STANDARD_COST_CURRENCY 
FROM STG_HAA_INVENTORY
WHERE PROCESSED_FLAG='N');

COMMIT;

UPDATE STG_HAA_INVENTORY A
SET PROCESSED_FLAG     = 'Y',
    PROCESSED_DATE   = SYSDATE,
    PROCESSED_USERID = 'haa_inventory_load'
WHERE  PROCESSED_FLAG     = 'N';
commit;

UPDATE STG_HAA_INVENTORY A
SET PROCESSED_FLAG     = 'Y',
    PROCESSED_DATE   = SYSDATE,
    PROCESSED_USERID = 'haa_inventory_load'
WHERE PROCESSED_FLAG     = 'N';
commit;
